import React from 'react';
import API from '../Api';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';
import deepOrange from '@material-ui/core/colors/deepOrange';
import {DataTable,Column} from 'primereact/datatable';

class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: {data:[]} };
        
    }

    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            this.setState({fiduca: data});
        });
        
    }
    
    render() {
        let cols = [
            {field: 'fgarIdFideicomiso', header: 'Fiso'},
            {field: 'fgarCveGarantia2', header: 'Garantia'},
            {field: 'fgarImpGarantizadFormatted', header: 'Importe'},
            {field: 'fgarCveStatus', header: 'Status'}
        ];

        let dynamicColumns = cols.map((col,i) => {
            return <Column key={col.field} field={col.field} header={col.header} />;
        });

        return (
            <DataTable value={this.state.cars}>
                {dynamicColumns}
            </DataTable>
        );
    }
}
export default BienesApi;
